const errorTypeFunc = (errorCode) => {
  switch (errorCode) {
    case 401:
      return {
        error_type: 'NOT_AUTHORIZED',
        payload: 'Could not find a user with this password',
      };
    case 500:
      return 'VALIDATION_ERROR';
    case 501:
      return 'NOT_FOUND_ERROR';
  }
};

export default errorTypeFunc;
